			["actions"] = {
				["start"] = {
					["sound"] = "Interface\\AddOns\\WeakAuras\\Media\\Sounds\\AirHorn.ogg",
					["do_sound"] = true,
				},
				["init"] = {
					["custom"] = "aura_env.spells = {\n    [254919] = true, --forging strike\n    \n    \n}\n\nfunction aura_env.GetAllUnitIDs(maxDepth)\n    local candidates ={\n        'player',\n        'target',\n        'mouseover',\n        'pet',\n        'npc',\n        'focus',\n        'vehicle',\n        'none', --included for completeness\n    }\n    for i = 1,40 do\n        tinsert(candidates,\"nameplate\"..i)\n        tinsert(candidates,\"raid\"..i)\n        tinsert(candidates,\"raidpet\"..i)\n    end\n    for i = 1,4 do\n        tinsert(candidates,\"party\"..i)\n        tinsert(candidates,\"partypet\"..i)\n        tinsert(candidates,\"arena\"..i)\n        tinsert(candidates,\"boss\"..i)\n    end\n    tinsert(candidates,\"arena5\")\n    tinsert(candidates,\"boss5\")\n    local validUnits = {}\n    --0 will only check primitive\n    maxDepth = type(maxDepth) == \"number\" and maxDepth or 0\n    maxDepth = floor(maxDepth)\n    local iterations = 0\n    while true do\n        --we go backwards because it was easier for me\n        for i = #candidates,1,-1 do\n            local unit, GUID = candidates[i], UnitGUID(candidates[i])\n            --can't just pop the final bit off, since we do insert other bits on\n            tremove(candidates,i)\n            if UnitExists(unit) then\n                --keying by GUID allows us to quickly find duplicates\n                if not validUnits[GUID] or #validUnits[GUID] > #unit then\n                    validUnits[GUID] = unit\n                    --needs to go on the end so as to not corrupt the traversal\n                    tinsert(candidates,unit..'target')\n                end\n            end\n        end\n        iterations = iterations + 1\n        if maxDepth >= 0 and maxDepth < iterations then break end\n        if #candidates == 0 then break end\n    end\n    return validUnits\nend",
					["do_custom"] = true,
				},
				["finish"] = {
				},
			},
			["text2Font"] = "PT Sans Narrow",
			["keepAspectRatio"] = false,
			["selfPoint"] = "CENTER",
			["trigger"] = {
				["custom_hide"] = "timed",
				["type"] = "custom",
				["spellIds"] = {
				},
				["subeventSuffix"] = "_CAST_START",
				["names"] = {
				},
				["custom"] = "function(allstates, event, ...)\n    local _, sub, _, sourceGUID = ...\n    local spellID, spellName = select(12, ...)\n    \n    if sub == \"SPELL_CAST_START\"\n    and aura_env.spells[spellID]\n    then\n        local aura_env = aura_env\n        C_Timer.After(0.1, function()\n            local units = aura_env.GetAllUnitIDs()\n            if units[sourceGUID] then\n                local unit = units[sourceGUID]\n                if UnitIsUnit(unit..\"target\", \"player\")\n                then \n                    local name, _, _, icon,startC, endC = UnitCastingInfo(unit)\n                    local duration, expiration = (endC - startC)/1000, endC/1000\n                    aura_env.unit = unit\n                    \n                    allstates[sourceGUID] = allstates[sourceGUID] or {};\n                    local state = allstates[sourceGUID];\n                    state.show = true;\n                    state.changed = true;\n                    state.autoHide = true;\n                    state.index = sourceGUID\n                    state.resort = true\n                    state.name = name\n                    state.progressType = \"timed\"\n                    state.duration = duration\n                    state.expirationTime = expiration\n                    state.icon = icon or 134400;\n                end\n            end\n        end)\n    end\n    return true\nend",
