			["customText"] = "function()\n    local coloredName = function(name) \n        local _, class = UnitClass(name) \n        return string.format(\"|c%s%s\", RAID_CLASS_COLORS[class].colorStr, name) \n    end\n    \n    local result = \"Shots:\"\n    local spell = GetSpellInfo(236305)\n    local duration = 0\n    local expires = 0\n    \n    for i=1, GetNumGroupMembers() do\n        local  name2 = GetRaidRosterInfo(i)\n        if UnitDebuff(name2, spell) then\n            local name3, rank, icon, count, debuffType, duration, expires = UnitDebuff(name2, spell)\n            duration = expires - GetTime()\n            result = result..string.format(\"\\n%s%s%d\", coloredName(name2), \" - \", duration)\n            \n        end\n        \n        \n    end\n    \n    return result\nend\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n",
