			["customText"] = "function()\n    if  WeakAuras.IsOptionsOpen() then\n        aura_env.check[1] = 0\n        aura_env.name = {}\n        aura_env.duration = {}\n        aura_env.duration2 = {}\n        aura_env.activecheck = {}\n        return \"NAME - RDY\"\n    else\n        local coloredName = function(name)\n            local _, class = UnitClass(name)\n            return string.format(\"|c%s%s\", RAID_CLASS_COLORS[class].colorStr, name)\n        end\n        result = \"\"\n        if aura_env.check[1] ~= GetNumGroupMembers() then\n            aura_env.check[1] = 50\n            return \"updating...\"\n        end\n        \n        for i=1,table.getn(aura_env.name) do\n            local name,realm = UnitName(aura_env.name[i])\n            if aura_env.name[i] ~= nil then\n                if aura_env.activecheck[i] == 0 then\n                    color = \"FFFFFFFF\" -- white\n                    result = result..string.format(\"%s |c%s%s%s\\n\", coloredName(name), color, \" - \", \"RDY\")\n                elseif aura_env.activecheck[i] == 1 then\n                    color = \"FF00F9FF\" -- teal\n                    cooldown = aura_env.duration[i] - GetTime()\n                    result = result..string.format(\"%s |c%s%s%d\\n\", coloredName(name), color, \" - \", cooldown+0.5)\n                elseif aura_env.activecheck[i] == 2 then\n                    color = \"FF00FF00\" -- green\n                    cooldown = aura_env.duration[i] - GetTime()\n                    result = result..string.format(\"%s |c%s%s%d\\n\", coloredName(name), color, \" - \", cooldown+0.5)\n                elseif aura_env.activecheck[i] == 3 then\n                    color = \"FFFF0000\" -- red\n                    cooldown = aura_env.duration2[i] - GetTime()\n                    result = result..string.format(\"%s |c%s%s%d\\n\", coloredName(name), color, \" - \", cooldown+0.5)\n                end\n            end\n            \n        end\n        if result == \"\" then\n            aura_env.check[1] = 50\n            return \"updating...\"\n        end\n        \n        return result\n        \n    end\n    \nend\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n",
